import React from 'react';
import menuClass from './checkoutMenu.module.css';

function CheckoutMenu(props){
    return(
        <div className={menuClass.menu}>
            <ul className={menuClass.menuList}>
                <li className={menuClass.active}>B A G</li>
                <li><hr /></li>
                <li>A D D R E S S</li>
                <li><hr /></li>
                <li>P A Y M E N T</li>
            </ul>
        </div>
    );
}

export default CheckoutMenu;
